  - Menu:
      id: menu_test
      label: Teams
  - Query:
      id: my_team
      query: >-
        MATCH (q:Person)-[]->(t:Team)-[*..2]-(e) where id(q) = '_ME_' AND NOT
        e:Repository return q,t,e
      label: My Team
  - Query:
      id: team_projects
      query: "MATCH (me:Person)--(t:Team) WHERE id(me) = '_ME_'\n\t\tMATCH (p:Person)--(t)\n\t\tMATCH (r:Project)--(p)\n\t\tRETURN r,p"
      label: Projects of my team
  - Query:
      id: less_than_5
      query: >-
        MATCH (t:Team) WHERE size((t)<-[]-(:Person)) < 5 MATCH (t)--(p:Person)
        return t,p
      label: Small teams
  - Query:
      id: active_project
      query: 'MATCH (p:Project {_active: false})  RETURN p'
      label: Inactive projects
  - Query:
      id: project coordinators
      query: MATCH (p:Person)-[:IS_COORDINATOR_OF_PROJECT]->(p2:Project) RETURN p, p2
      label: Project coordinators
  - Query:
      id: all_teams
      query: MATCH (t:Team) RETURN t
      label: All teams
  - Query:
      id: site_maintainers
      query: MATCH (p:Person)-[:CONTENT_MANAGER_OF]->(s:Site) RETURN p, s
      label: Site content managers
